b'Thomas Tuchel on Mason Mount:

\xf0\x9f\x97\xa3\xef\xb8\x8f"We play most games with three strikers and Mason is one of them. We depend heavily on him. He plays a key role. We want to depend on Mason because we like his style and personality. He is a top player and a top guy."

@masonmount_10 | #CFC https://t.co/lDftVOu0Ku'

b'Mason Mount on his match ball:

\xf0\x9f\x97\xa3\xef\xb8\x8f"I\xe2\x80\x99m gonna get it boxed up along with the shirt probably. It\xe2\x80\x99s good for memories, to look back. To score a hat-trick at the Bridge in front of the home fans is something you dream of. This is definitely a special day."

